import React from "react";

const FieldGenerator = ({onPercentCreate}, {onDollarCreate}) => {
    return (
        <div className="tc">
            <p>What type of pricing do you use?</p>
            <button
            className=""
            onClick={this.onPercentCreate}
            >Percentage (%)</button>
            <button
            className=""
            onClick={this.onDollarCreate}
            >Dollar ($)</button>
        </div>
    )
}

export default FieldGenerator;
